import React from "react";
import popular_movie_data from "../data/popular_movie_data";
import Card_Movie from "./Card_Movie";
//   title,
//   release_date,
//   vote_average,
//   poster_path,
export const Movie_List = () => {
  const movies = popular_movie_data.results;
  return (
    <section className="border border-gray-400 py-10 grid-cols-4">
      <div className="justif-center">
        {movies.map((movie, index) => {
          const { title, release_date, vote_average, poster_path } = movie;
          return (
            <Card_Movie
              key={index}
              title={title}
              release_date={release_date}
              vote_average={vote_average}
              poster_path={poster_path}
            />
          );
        })}
      </div>
    </section>
  );
};

export default Movie_List;
